import React from 'react';
import { ReactComponent as LinkedInIcon } from '../assets/linkedin.svg';
import { ReactComponent as GitHubIcon } from '../assets/github.svg';

const Footer = () => {
    return (
        <header style={styles.header}>
            {/* Left Side: Website Name */}
            <div style={styles.left}>
                <a href="/" style={styles.link}>
                    Chase C. Vitale
                </a>
            </div>

            {/* Right Side: Links */}
            <div style={styles.right}>
                <a href="/resume" style={styles.link}>
                    Resume
                </a>
                <a href="https://www.linkedin.com/in/chasecvitale/" target="_blank" rel="noopener noreferrer" style={styles.link}>
                    <LinkedInIcon style={{ width: '25px', fill: 'white' }} />
                </a>
                <a href="https://github.com/chasecvitale" target="_blank" rel="noopener noreferrer" style={styles.link}>
                    <GitHubIcon style={{ width: '25px', fill: 'white' }} />
                </a>
            </div>
        </header>
    );
};

const styles = {
    header: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '50px',
        backgroundColor: '#2a2829',
    },
    left: {
        fontSize: '1.5rem',
    },
    right: {
        display: 'flex',
        gap: '1.5rem',
        alignItems: 'center',
    },
    link: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '1rem',
    },
};

export default Footer;
